import React from 'react'
import { Loader, Placeholder } from 'rsuite';
function Loading() {
    const App = () => (
        <div>
          <Placeholder.Paragraph rows={8} />
          <Loader center content="loading" />
        </div>
      );
  return (
    <div>Loading</div>
  )
}

export default Loading;
